import {
  Container, 
  Title, 
  Description,
  Wrapper,
  Background,
  CardContainer,
  InfoContainer,
  Header,
} from "src/components/MainPages";
import Image from 'src/images/background.png';
import { FARMS } from "src/config";
import { FarmEntry } from './FarmEntry';


export const Farm = () => {
  return (
    <Wrapper>
      <Container>
        <Title>Farm</Title>
        <Description>
          Unlock leverage up to <span>2.5x</span>
        </Description>
      </Container>
      <CardContainer>
        <InfoContainer>
          <Header>
            <h2>Pool</h2>
            <h2>Projected APY %</h2>
            <h2 className='center'>Pool APY</h2>
            <div></div>
            <h2>Borrow APY</h2>
            <h2>Max Leverage</h2>
            <div></div>
          </Header>
          {FARMS.map((farm) => (
        <FarmEntry key={farm.name} werc20={farm.werc20} name={farm.name} wstaking={farm.wstaking} spell={farm.spell} tokens={farm.tokens} lp={farm.lp} />
      ))}
        </InfoContainer>
      </CardContainer>
      <Background src={Image} alt='Background Logo' />
    </Wrapper>
  );
};
